-- To create USERS, INVENTORY tables:
CREATE TABLE Users (
    userID INT AUTO_INCREMENT PRIMARY KEY,
    full_name VARCHAR(100),
    username VARCHAR(50),
    password VARCHAR(70),
    salt VARCHAR(32),
    email VARCHAR(100),
    phone VARCHAR(10),
    role ENUM('Viewer', 'Admin'),
    created_at DATE
);

CREATE TABLE Inventory (
    RFID CHAR(16) PRIMARY KEY,
    brand VARCHAR(20),
    device_type VARCHAR (50),
    status ENUM('In Transit', 'Warehouse', 'Shopfront') NOT NULL,
    address VARCHAR(100),
    city VARCHAR(30),
    state ENUM('ACT', 'NSW', 'QLD', 'VIC', 'WA', 'SA', 'NT', 'TAS'),
    postcode CHAR(4),
    created_at DATE,
    last_scanned DATE
);



